import React, { Component } from 'react';
import { TodoContainer } from './components/TodoContainer';
import { TodoMainTitle } from './components/ToDoMainTitle';

const style = {
  container: {
    display: 'flex',
    height: '100vh',
    width: '100%',
    justifyContent: 'center',
    alignItems: 'center'
  }
} 

class App extends Component {
  render() {
    return (
      <div className="App" style={style.container}>
        <ToDoContainer>
          <TodoMainTitle text={"Task Manager"} />
        </ToDoContainer>
      </div>
    );
  }
}

export default App;
